import React from 'react';

function Stats() {
    return ( 
       <div className='container'>
        <div className='row'>
            <div className='col-6'></div>
            <div className='col-6'>
                <img src='media/images/ecosystem.png' style={{width:"75%"}}/>
            </div>
        </div>
       </div>
     );
}

export default Stats;
